Permissive licenses like CC0, public domain, and CC-BY open up a world of opportunities for creators, while bringing awareness and attention back to source projects.

With the freedom those licenses offered, I created these generative quests that bring together art from a wide variety of NFTs. The quests are a glimpse of the power of open licensing, and are fun mashups from these early, wild days in the space. 

Thanks to all projects offering permissive licenses, and be sure to check out those used here:

